css:
@-moz-document domain("file-upload.com") {
div.page-wrap {
    background-color: #000000;
}
nav.navbar.navbar-default {
    background-color: #4e4b99;
}
div.header-top {
    background-color: #4e4b99;
}
section.page-content {
    background-color: #4e4b99;
}
h1.default-ttl.text-center {
    color: #00ff09;
}
div.bottom-footer {
    display: none;
}
html.js.flexbox.flexboxlegacy.fa-events-icons-ready body footer {
    display: none;
}
html.js.flexbox.flexboxlegacy.fa-events-icons-ready {
    background-color: #4e4b99;
}
ul.nav.navbar-nav.navbar-right li a {
    color: #0dff3d;
}
div.dareaname {
    background-color: #0dd69d;
}
div.compare-col h2 {
    display: none;
}
div.compare-col ul {
    display: none;
}
input.btn.btn-xs.btn-success.mnbt1 {
    display: none;
}
input.btn.btn-xs.btn-primary.mnbt1 {
    font-size: 24px;
    font-weight: bold;
    color: #00ff33;
}
div.tabs.tabs-style-linebox nav ul {
    display: none !important;
}
textarea.form-control {
    display: none !important;
}
section.content-current {
    display: none !important;
}
div.captchatxt {
    color: #f01330;
}
div.collapse.navbar-collapse {
    display: none !important;
}
div.top-info {
    display: none !important;
}
section.page-content {
    margin-top: -50px !important;
}
#countdown {
    color: #00f562 !important;
}
}
